import React, { useEffect, useState } from "react";
import pb from "../utils/pocketbaseClient";
import { formatNumber } from "../utils/formatNumber";
import { useTheme } from "../context/ThemeContext";

export default function MoleConverter({ categoryId }) {
  const [inputValue, setInputValue] = useState("");
  const [parentUnits, setParentUnits] = useState([]);
  const [childUnits, setChildUnits] = useState([]);
  const [selectedParent, setSelectedParent] = useState(null);
  const [selectedChild, setSelectedChild] = useState(null);
  const [convertedValue, setConvertedValue] = useState(null);
  const [displayMode, setDisplayMode] = useState("general");

  const theme = useTheme();

  // Fetch units and filter parent/child
  useEffect(() => {
    async function fetchUnits() {
      try {
        const units = await pb.collection("units").getFullList({ filter: `category="${categoryId}"` });
        const parents = units.filter((u) => u.parent_unit === null);
        const children = units.filter((u) => u.parent_unit !== null);

        setParentUnits(parents);
        setChildUnits(children);
        if (parents.length > 0) setSelectedParent(parents[0]);
        if (children.length > 0) setSelectedChild(children[0]);
      } catch (error) {
        console.error("Error fetching Mole units:", error);
      }
    }
    fetchUnits();
  }, [categoryId]);

  // Conversion logic
  useEffect(() => {
    if (!inputValue || !selectedParent || !selectedChild) {
      setConvertedValue(null);
      return;
    }

    const input = parseFloat(inputValue);
    if (isNaN(input)) {
      setConvertedValue(null);
      return;
    }

    // Convert to base using parent, then to target child
    const toBase = input * selectedParent.value;
    const result = toBase / selectedChild.value;

    setConvertedValue(result);
  }, [inputValue, selectedParent, selectedChild]);

  return (
    <div className="p-4" style={{ backgroundColor: theme?.surface }}>
      <h2 className="text-xl font-bold mb-2" style={{ color: theme?.heading }}>Mole Converter</h2>

      {/* Input */}
      <input
        type="number"
        className="p-2 border rounded w-full mb-4"
        placeholder="Enter value"
        value={inputValue}
        onChange={(e) => setInputValue(e.target.value)}
        style={{ backgroundColor: theme?.input || "#fff", color: theme?.text }}
      />

      {/* From Unit */}
      <label className="block mb-1 font-medium">From</label>
      <select
        className="p-2 border rounded w-full mb-4"
        value={selectedParent?.id || ""}
        onChange={(e) =>
          setSelectedParent(parentUnits.find((u) => u.id === e.target.value))
        }
      >
        {parentUnits.map((unit) => (
          <option key={unit.id} value={unit.id}>
            {unit.name} ({unit.symbol})
          </option>
        ))}
      </select>

      {/* To Unit */}
      <label className="block mb-1 font-medium">To</label>
      <select
        className="p-2 border rounded w-full mb-4"
        value={selectedChild?.id || ""}
        onChange={(e) =>
          setSelectedChild(childUnits.find((u) => u.id === e.target.value))
        }
      >
        {childUnits.map((unit) => (
          <option key={unit.id} value={unit.id}>
            {unit.name} ({unit.symbol})
          </option>
        ))}
      </select>

      {/* Display Toggle */}
      <div className="flex gap-2 mb-4">
        <button
          onClick={() => setDisplayMode("general")}
          className={`px-4 py-2 rounded ${displayMode === "general" ? "bg-yellow-400" : "bg-gray-300"}`}
        >
          General
        </button>
        <button
          onClick={() => setDisplayMode("scientific")}
          className={`px-4 py-2 rounded ${displayMode === "scientific" ? "bg-yellow-400" : "bg-gray-300"}`}
        >
          Scientific
        </button>
      </div>

      {/* Result */}
      {convertedValue !== null && (
        <div className="p-4 border rounded bg-white text-center text-lg font-semibold">
          {displayMode === "scientific"
            ? Number(convertedValue).toExponential(4)
            : formatNumber(convertedValue)}
        </div>
      )}
    </div>
  );
}
